import React, { Component } from 'react';
import { Container, Jumbotron,Row,Col,Card } from 'reactstrap';
import { Media,CardBody,CardImg,CardTitle,CardText,CardSubtitle,Button } from 'reactstrap';

class Profile extends Component {
    constructor(props){
        super(props);
    }

    
  render()
   {
    return (
      <Jumbotron >
        <Media>
         <Container>
          <div class="media">
          
           <img class="align-self-center ml-3" data-src="cinqueterre.jpg" alt="Avatar"class="rounded-circle"></img>
           <p></p>

           <div class="w-100 p-3" >
            
             <h2 class="ml=5">    Username</h2>
           </div>
            
          
          </div>
         </Container>
          <Container>
          <div>
      <Card>
        <CardImg top width="100%" src="/assets/318x180.svg" alt="Card image cap" />
        <CardBody>
          <CardTitle tag="h5">Card title</CardTitle>
          <CardSubtitle tag="h6" className="mb-2 text-muted">Card subtitle</CardSubtitle>
          <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
          <Button>Button</Button>
        </CardBody>
      </Card>
    </div>
          </Container>
         
        </Media>
      </Jumbotron>
    );
   };
}

export default Profile
